const Icon = ({ name }) => {
  switch (name.toLowerCase()) {
    case 'buyer':
      return <Buyer />;
    case 'supplier':
      return <Supplier />;
    case 'transporter':
      return <Transporter />;
    case 'auditor':
      return <Auditor />;

    case 'factor-1':
    case 'factor-2':
      return <Factor />;

    default:
      return <Buyer />;
  }
};

